import React from 'react';

import img1 from './images/Treasure-hunt.jpeg';


import { CardColumns,CardGroup,Card,Button,Container,Nav,Navbar,NavDropdown,Row,Col } from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.min.css';
import './SingleCard.css';

const SingleCard = (props) => {
  const commaNumber = require('comma-number')


  const decimals = props.decimals;


  // commaNumber('-1000,12', '.', ',') // "-1.000,12"




  return(

    <Container className='mt-5' fluid="md">


    <Row >

    <Col>
    <div className="spaceTop">
      <Card className="customRoundedOne">
      <Card.Header >Prize in BLOX</Card.Header>
      <Card.Body className='customBodyTwo'>
        <div className="gameMainTitle">Total Treasure for Elon's Rocket</div>

        <div className="gamePrize">Prize {props.game1_prize} Blox</div>
        <div className="postMainPrize">Est $1,000.00</div>
        <div>Game Attempts {props.allGame1_total_game_tries}</div>



      </Card.Body >

      </Card>
    </div>

    </Col>
    <Col>
    <div className="spaceTop">
      <Card className="customRoundedOne">
      <Card.Header >Riddle</Card.Header>
      <Card.Body className='customBody'>
        <Card.Title>Elon's lost his Rocket!</Card.Title>
        <Card.Text>
          {props.game1_riddle}


        </Card.Text>

      </Card.Body >
      <blockquote className="blockquote mb-0 card-body">
        <p>
          {props.game1_clue}?
        </p>
        <footer className="blockquote-footer">
          <small className="text-muted">
            Signed <cite title="Source Title"> other half</cite>
          </small>
        </footer>
      </blockquote>
      </Card>
    </div>


    </Col>
  </Row>





    </Container>


  );


};

export default SingleCard;
